# Miniblock configuration file
#
# To add a new miniblock, simply add a new configuration
# section in the following format:
# unique_block_name:
#   name: String - Name displayed to user
#   texture: String - end of minecraft.net texture URL, can be found at minecraft-heads.com in 
#                     the "Other" section.
#   block: String - bukkit Material name, to be used as part of payment in addtion to Emeralds, 
#                   this must be exact but does not have to match the block, and must be populated 
#                   even if not being used (use anything you like, AIR is an easy filler).
#   block_quantity: integer - the number of blocks required as payment,  if set to 0, no blocks required
#   enabled: boolean (true/false) -  used to disable a block
#
#
# Valid example -
# coffee_cup:
#   name: Coffee Cup
#   texture: 235e3ddfe8f9b5163ce7cba7154844114537a43102e0f8a7821e59c659ef2573
#   block: AIR  # Choosing air as a filler block, it's not going to be part of payment
#   block_quantity: 0
#   enabled: true

